import unittest
from collections import Counter

p = 1000000007
limit = 100000

f = [1] * limit

for i in range(1, limit):
    f[i] = f[i - 1] * i


def answerQuery(l, r, s):
    c = Counter(s[l - 1:r])

    singles = 0
    even = 0
    d = list()

    for k, v in c.items():
        if v == 1:
            singles += v
            continue

        divisor = v // 2

        if v % 2 == 0:
            even += v
        else:
            singles += 1
            even += v - 1
            divisor = (v - 1) // 2

        d.append(divisor)

    even = f[even // 2]
    product = 1

    for divisor in d:
        product *= f[divisor]

    if singles == 0:
        singles = 1

    return ((even // product) * singles) % p


class TestStringMethods(unittest.TestCase):

    def test_a1(self):
        self.assertEqual(answerQuery(4, 7, "madamimadam"), 2)

    def test_a2(self):
        self.assertEqual(answerQuery(1, 11, "madamimadam"), 30)

    def test_b(self):
        self.assertEqual(answerQuery(1, 4, "week"), 2)

    def test_c(self):
        self.assertEqual(answerQuery(2, 3, "week"), 1)

    def test_d(self):
        self.assertEqual(answerQuery(53, 92,
                                     "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"),
                         4845)

    def test_e(self):
        self.assertEqual(answerQuery(52, 98,
                                     "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"),
                         8855)

    def test_f(self):
        self.assertEqual(answerQuery(30, 97,
                                     "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"),
                         1344904)

    def test_g(self):
        self.assertEqual(answerQuery(40, 41,
                                     "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"),
                         1)

    def test_h(self):
        self.assertEqual(answerQuery(100, 100,
                                     "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"),
                         1)

    def test_i(self):
        self.assertEqual(answerQuery(148, 99940,
                                     ""),
                         832684578)


if __name__ == '__main__':
    unittest.main()
